      "faqs": [
        {
          "id": "r6TCNoH3rfDe5Z9ETTV5",
          "question": "¿hello?",
          "answer": "yooooo",
          "category": "General",
          "order": 1
        },
        {
          "id": "pN4fNIoa0DuuW1Zutkgv",
          "question": "¿Con cuánto tiempo de anticipación debo contactarlos?",
          "answer": "El tiempo mínimo es de una semana. De esta forma nos aseguramos de entender bien las características de tu evento y poder garantizarte el mejor resultado.\nSi te encuentras en una emergencia y no tienes una semana, contanos al respecto y nuestra disposición es la de poder ayudar.",
          "category": "General",
          "order": 2
        },
        {
          "id": "O58pCRDY89zCQMGWxjv1",
          "question": "¿Cómo se realiza la entrega del material?",
          "answer": "Formatos digitales, álbumes, USB, galería online… nos adaptamos a tus preferencias.",
          "category": "General",
          "order": 3
        },
        {
          "id": "VbTmu1PtnQ67CcPZw2Ek",
          "question": "¿Cuánto tarda la entrega del material fi nal?",
          "answer": "La velocidad nos caracteriza. En una plazo de una semana a dos semanas podemos entregarte el material.",
          "category": "General",
          "order": 4
        },
        {
          "id": "3rA4vga0x8CgGI185nUX",
          "question": "¿Cuántos fotógrafos o camarógrafos son asignados por evento?",
          "answer": "Los que sean necesarios; no es lo mismo un casamiento multitudinario a una lectura de poesía íntima. Por eso enfatizamos entender las características puntuales de tu evento.",
          "category": "General",
          "order": 5
        },
        {
          "id": "OoguSYTkzeyvuWtAEKPe",
          "question": "¿Puedo solicitar fotos o videos específi cos durante un evento?",
          "answer": "Sí, sin dudas. El cliente tiene la posibilidad, tanto en la preparación del evento como durante el mismo, de solicitar priorizar determinados elementos o personas por sobre otros.",
          "category": "General",
          "order": 6
        },
        {
          "id": "Xmb4W69SO94hyLdggF1u",
          "question": "¿Cómo se maneja la privacidad y el uso de las imágenes?",
          "answer": "Las imágenes y los videos son propiedad del cliente y no guardamos ningún derecho sobre ellos. Excepcionalmente podemos solicitarte autorización para utilizar el material a fi nes de difusión, pero dependemos de tu aprobación.",
          "category": "General",
          "order": 7
        },
        {
          "id": "bxVVZ8T5rRDKXqiRDFYL",
          "question": "¿Cómo funciona el sistema de pagos?",
          "answer": "Una vez que se confi rma el presupuesto, solicitamos un pago del 30% total a modo de garantía. El 70% restante se realiza posterior a la entrega del material.",
          "category": "General",
          "order": 8
        },
        {
          "id": "yV9BMf3BqNGBWTSXBrN4",
          "question": "¿Qué pasa si el evento se cancela o se pospone?",
          "answer": "Si el evento se cancela hacemos un reintegro del 30% abonado. En caso de que el evento se posponga, nos adaptamos a la nueva fecha independiente de cuál sea ésta.",
          "category": "General",
          "order": 9
        },
        {
          "id": "4lJYNrFMS0KdsE78mf4s",
          "question": "¿Qué medios de pago aceptamos?",
          "answer": "Aceptamos pagos por transferencia bancaria, débito o crédito.",
          "category": "General",
          "order": 10
        },
        {
          "id": "vNRTM6oBYmdomSGhY5Gn",
          "question": "¿Qué se puede ofrecer además de coberturas?",
          "answer": "Adicionalmente a la cobertura de tu evento, también realizamos sesiones en estudio previas o post evento, retratos en locación y entrevistas.",
          "category": "General",
          "order": 11
        },
        {
          "id": "arB0nFxXV0MBtWpzVyr8",
          "question": "¿Puedo elegir el estilo o tono del registro?",
          "answer": "¡Sin duda! Parte del trabajo que hacemos durante la preparación es entender tus pretensiones estéticas para adaptarnos a ellas y asignar al equipo que mejor pueda materializarlas.",
          "category": "General",
          "order": 12
        },
        {
          "id": "fI8dJEC6ZB6xW5RmgtW4",
          "question": "¿Ofrecen servicio de cobertura para eventos sorpresa?",
          "answer": "Sí, nos encanta. En ese caso trabajamos estrechamente con organizador para entender la modalidad de la sorpresa, analizamos el espacio para colocar cámaras ocultas y nos hacemos parte de los invitados capturando así lo genuino y espontáneo de lo que ocurra.",
          "category": "General",
          "order": 13
        }
      ],
